  public final String filename;
  public final String url;
  public final String sha1;
  public final String md5;
  public final long modTime;
  public final int filesize;
  public final boolean legacy;
  public final boolean grujed;
  public final boolean opted;
  public final int optSize;

  SBTVersion(
      final String filename,
      final String url,
      final String sha1,
      final String md5,
      final int modTime,
      final int filesize,
      final boolean legacy,
      final boolean grujed,
      final boolean opted,
      final int optSize) {
    this.filename = filename;
    this.url = url;
    this.sha1 = sha1;
    this.md5 = md5;
    this.modTime = modTime * 1000L;
    this.filesize = filesize;
    this.legacy = legacy;
    this.grujed = grujed;
    this.opted = opted;
    this.optSize = optSize;
  }
